import React from 'react'

const CustomInput = ({placeholder, value, onChange, src, required}) => {
    return (
        <div className='container flex items-center justify-center border-w'>
        {BeforeIcon && <img src={src}/>}
            <input
                placeholder={placeholder}
                value={value}
                onChange={onChange}
                required={required}
            />
        </div>
    )
}

export default CustomInput
